const initialState = {
    gnomes : []
} 
export default function (state = initialState, action) {
    // eslint-disable-next-line default-case
    switch (action.type) {
        case 'FETCH_GNOMES':
            return {
                ...state,
                gnomes: action.payload
            }
        default:
            return state;
    }
}
